import {
    Card,
    CardActionArea,
    CardContent,
    CardMedia,
    Tooltip,
    Typography,
} from '@mui/material';
import './home.scss';
import logo from '../../images/Job hunt-amico.png';

export const Home = () => {
    return (
        <div className='card'>
            <Card sx={{ maxWidth: 345 }}>
                <CardActionArea>
                    <Tooltip title='Job illustrations by Storyset' placement='top'>
                        <CardMedia
                            component='img'
                            height='140'
                            image={logo}
                            alt='storySet-Image'
                        />
                        
                    </Tooltip>
                    <CardContent>
                        <Typography gutterBottom variant='h5' component='div'>
                            Welcome to the Resume Management Resource React-App
                        </Typography>
                        <Typography variant='body2' color='text.secondary'>
                            This is a Resume Management Resouce builder, built
                            in React18 for the frontend and Asp.Net as the
                            backend. This is a simple CRUD operation of grids to
                            hold on to job sources and pdf files for the
                            respected roles. Try it out!
                        </Typography>
                    </CardContent>
                </CardActionArea>
            </Card>
        </div>
    );
};

export default Home;
